(17, 'Australia, officially the Commonwealth of Australia, is a sovereign country comprising the mainland of the Australian continent, the island of Tasmania, and numerous smaller islands. With an area of 7,617,930 square kilometres, Australia is the largest country by area in Oceania and the world\'s sixth-largest country', 'data:image/jpeg;base64,', 'ayushi1407', 2, 'Trip to USA.', 'New York', '2022-09-05 14:41:34', 'https://res.cloudinary.com/dbcpdiy45/image/upload/v1663177613/mkpndn2ck4sdesins3wj.jpg'),
